import React from 'react';
import ToDo from './ToDo';

const ToDoList = ({tasks}) => (
    <section>
        <ul>
            {
                tasks.map(
                    (arg) => <ToDo task={arg} />
                )
            }
        </ul>
    </section>
)

export default ToDoList;
